import React from 'react';
import styled from '@emotion/styled';

const StickPage = styled.div`
display: flex;
flex-direction: column;
width:100%;
height:92.7vh;
`;
const StickTitle = styled.div`
height:10%;
font-size: 50px;
text-align: center;
`
const SticksDisplay = styled.div`
display: flex;
flex-direction: row;
flex-wrap: wrap;
width:100%;
height: 90%;
justify-content: center;
align-items:center;
`
const Item = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
align-items:center;
margin:70px;
`
const SticksContainer = () => {
    return (  
        <StickPage>
            <StickTitle>Sticks</StickTitle>
            <SticksDisplay style={{display:"flex",flexDirection:"row", backgroundColor:"white"}}>
                <Item>
                    <img style={{width: "200px", marginLeft:"3px"}} src={require('./ice-hockey.png')} alt="icehockey" />
                    <div>Bauer Stick</div>
                    <div>$300</div>
                </Item>
            </SticksDisplay>
        </StickPage>
    );
}
 
export default SticksContainer
